description:
Johnny (Pawan Kalyan) is an orphan and a martial arts coach. He falls in love with another orphan called Geetha (Renu Desai), who is a teacher. They 

get married. Later on, it is revealed that Geetha suffers from blood cancer. She needs lots of money to get operated. Rest of the story is about how 

Johnny managed to get the money through fights to save Geetha. 



Written &amp; Directed by : Pawan Kalyan


story &amp; screenplay : Pawan Kalyan 


Starring : Pawan Kalyan, Renu Desai and Raghuvaran




